import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { UserAuth } from '../context/AuthContext';

const Signup = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [name, setName] = useState('');
  const [phone, setPhone] = useState('');
  const [gender, setGender] = useState('');
    const [heardFrom, setHeardFrom] = useState({
    linkedin: false,
    friends: false,
    jobPortal: false,
    others: false,
  });
  const [heardAbout, setHeardAbout] = useState([]);
  const [city, setCity] = useState('');
  const [state, setState] = useState('');
  const [error, setError] = useState('')
  const { createUser } = UserAuth();
  const navigate = useNavigate()

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    try {
      await createUser(email, password);
      navigate('/account')
    } catch (e) {
      setError(e.message);
      console.log(e.message);
    }
  };

  return (
    <div className='max-w-[700px] mx-auto my-16 p-4'>
      <div>
        <h1 className='text-2xl font-bold py-2'>Sign up for a free account</h1>
        <p className='py-2'>
          Already have an account yet?{' '}
          <Link to='/' className='underline'>
            Sign in.
          </Link>
        </p>
      </div>
      <form onSubmit={handleSubmit}>
        <div className='flex flex-col py-2'>
          <label className='py-2 font-medium'>Name</label>
          <input
            onChange={(e) => setName(e.target.value)}
            className='border p-3'
            type='text'
            pattern="^[a-zA-Z]*$"
            title="Only alphabets are allowed"
          />
        </div>

        <div className='flex flex-col py-2'>
          <label className='py-2 font-medium'>Email Address</label>
          <input
            onChange={(e) => setEmail(e.target.value)}
            className='border p-3'
            type='email'
          />
        </div>
        <div className='flex flex-col py-2'>
          <label className='py-2 font-medium'>Phone</label>
          <input
            onChange={(e) => setPhone(e.target.value)}
            className='border p-3'
            type='number'
          />
        </div>
        <div className='flex flex-col py-2'>
          <label className='py-2 font-medium'>Gender</label>
          <select
            onChange={(e) => setGender(e.target.value)}
            className='border p-3'
          >
            <option value="">Select Gender</option>
            <option value="male">Male</option>
            <option value="female">Female</option>
            <option value="others">Others</option>
          </select>
        </div>
        <div className='flex flex-col py-2'>
          <label className='py-2 font-medium'>How did you hear about this?</label>
          <div>
            <input
              onChange={(e) => setHeardFrom({ ...heardFrom, linkedin: e.target.checked })}
              type='checkbox'
              id='linkedin'
              name='linkedin'
            />
            <label htmlFor='linkedin'>LinkedIn</label>
          </div>
          <div>
            <input
              onChange={(e) => setHeardFrom({ ...heardFrom, friends: e.target.checked })}
              type='checkbox'
              id='friends'
              name='friends'
            />
            <label htmlFor='friends'>Friends</label>
          </div>
          <div>
            <input
              onChange={(e) => setHeardFrom({ ...heardFrom, jobPortal: e.target.checked })}
              type='checkbox'
              id='jobPortal'
              name='jobPortal'
            />
            <label htmlFor='jobPortal'>Job Portal</label>
          </div>
          <div>
            <input
              onChange={(e) => setHeardFrom({ ...heardFrom, others: e.target.checked })}
              type='checkbox'
              id='others'
              name='others'
            />
            <label htmlFor='others'>Others</label>
          </div>
        </div>
        <div className='flex flex-col py-2'>
          <label className='py-2 font-medium'>City</label>
          <select
            onChange={(e) => setCity(e.target.value)}
            className='border p-3'
          >
            <option value="">Select City</option>
            <option value="mumbai">Mumbai</option>
            <option value="pune">Pune</option>
            <option value="ahmedabad">Ahmedabad</option>
          </select>
        </div>
        <div className='flex flex-col py-2'>
          <label className='py-2 font-medium'>State</label>
          <input
            onChange={(e) => setState(e.target.value)}
            className='border p-3'
            type='text'
          />
        </div>
        <div className='flex flex-col py-2'>
          <label className='py-2 font-medium'>Password</label>
          <input
            onChange={(e) => setPassword(e.target.value)}
            className='border p-3'
            type='password'
          />
        </div>
        <button className='border border-blue-500 bg-blue-600 hover:bg-blue-500 w-full p-4 my-2 text-white'>
          Sign Up
        </button>
      </form>
    </div>
  );
};

export default Signup;
